import React from 'react';
// import '../stylesheets/.scss';

const Project = props => {
  console.log(props.project);

  const tecnologies = props.project.tecnologies.map((type, index) => {
    return <li className="type" key={index}>{type}</li>
  } );
  return (
    <div className="work">
      <ul className="project_container">
        <li className="project project1">
          <div className="project_links">
            <span className="web">www</span>
            <span className="github">cat</span>
          </div>
          <div className="img_container">
            <img className="image" src={props.project.img} alt="project-module-1" width="400px"></img>
          </div>
          <div className="project_info">
            <h2 className="project_info_title">{props.project.name}</h2>
            <p className="project_info_description">{props.project.description}</p>
            <ul className="project_info_tecnologies">
              <li>HTML</li>
              <li>CSS</li>
              <li>SASS</li>
            </ul>
          </div>
        </li>
      </ul>
    </div>
  );

}

export default Project;
